import React from "react";


export default function CalculadoraPuntos(){
  
  let puntosActuales;
  let nuevoMonto;
  let dineroPorPunto;
  let puntosTotal;



  
  
  
  
  return (
    <div>
      <h1>CALCULAR PUNTOS</h1>
      <p>1 Punto = {dineroPorPunto}</p>
      <p>Puntos Actuales: {puntosActuales}</p>
      <p>Nueva Compra: {nuevoMonto}</p>
      <p>Puntos Sumados:{puntosTotal - puntosActuales}</p>
      <p>Puntos Total:{puntosActuales + (nuevoMonto / dineroPorPunto)}</p>
    </div>
  )
}
